import React from 'react';
import { useState } from 'react';
import { nanoid } from 'nanoid';
import Square from '../Square';
import Row from '../Row';

export default function Level1(props) {
    // const [squareValue, setSquareValue] = useState();

    const row1 = [false, false, false, false, false, false, false, false, false, false];
    const row2 = [false, false, false, true, false, false, false, false, false, false];
    const row3 = [false, false, true, false, false, false, true, false, false, false];
    const row4 = [false, false, false, true, false, true, false, false, false, false];
    const row5 = [false, false, true, true, true, true, true, false, false, false];
    const row6 = [false, false, true, false, false, false, true, true, true, false];
    const row7 = [false, false, true, false, false, false, true, false, true, false];
    const row8 = [false, false, true, false, false, false, true, true, true, false];
    const row9 = [false, false, true, true, true, true, true, false, false, false];
    const row10 = [true, true, true, true, true, true, true, true, true, true];

    const rows = [row1, row2, row3, row4, row5, row6, row7, row8, row9, row10];

    const level1 = rows.map(row=>{
        return (
            <Row 
                row={row}
            />
        );
    })

    const boardRow1 = row1.map( tf =>{
        return (
            <Square 
                value={tf}
                key={'square-'+nanoid()}
            />
        );
    });

    const boardRow2 = row2.map(tf => {
        return (
            <Square 
                value={tf}
                key={'square-'+nanoid()}
            />
        );
    });

    const boardRow3 = row3.map(tf => {
        return (
            <Square 
                value={tf}
                key={'square'+nanoid()}
            />
        );
    });

    return (
        <div className='board'>
            {level1}
        </div>
    );
}
